import React from 'react';

const  Card = (props) => {
	return (
		<div className="tc bg-dark-green b-green dib br3 pa3 mr2 grow bw2 shadow-5">
			<img alt="robots" src={`https://robohash.org/${props.id}100x100`} />
			<div>
				<h1>{props.name}</h1>
				<p>{props.email}</p>
			</div>
		</div>
		);
}

export default Card;
